import React from "react";
import {BrowserRouter,Routes,Route} from "react-router-dom"
import Home from "./pages/Home.jsx"
import SideBar from "./components/SideBar.jsx"

const App = () => {
  return (
    <BrowserRouter>
  <SideBar/>
  <Routes>
    <Route path="/" element={<Home/>}/>
  </Routes>
    </BrowserRouter>
  );
};

export default App;
